import React from 'react'
import { Head } from './Components/Head'
import { BrowserRouter, Route, Routes } from 'react-router-dom'
const Middle = () => {
  return (
    <div>
      <h1>This si middle </h1>
    </div>
  )
}
export const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Middle />} />
        <Route path="/head" element={<Head />} />
      </Routes>
    </BrowserRouter>
  )
}
